INSERT INTO `rateco_borrower_question` (`question_id`, `question_pageid`, `question_orderid`, `question_title`, `question_slug`, `question_instruction`, `question_icon`, `question_optionid`, `question_fieldtype`, `question_status`, `question_datetime`, `question_phase`, `question_isshow`) VALUES
(1, 1, 1, 'Let\'s start with why you\'re looking for a loan', 'purpose', 'Knowing why you need the money can help us get you a better rate!', 'f7710ff663efe8f950a205da2aafe382.png', NULL, 'radio', 'Y', '2019-01-16 12:02:59', '1', 'Y'),
(2, 0, 2, 'Have you already approached a mortgage professional about your loan options?', 'approach', '', '61cf9c4f916b86b30c88a8920bd0968d.png', NULL, 'text', 'N', '2019-01-16 12:02:59', '1', 'Y'),
(3, 2, 2, 'How much do you want to borrow?', 'amount', 'We work with mortgage loans starting from $10,000!', '7392672f7b7fc35a01b721db0d63951d.png', NULL, 'text', 'Y', '2019-01-16 12:03:52', '1', 'Y'),
(4, 0, 3, 'What is your postal code?', 'postalcode', '', 'e8d5efdf3f71b1583ae0af3fc6747e35.png', NULL, 'text', 'Y', '2019-01-16 12:05:25', '1', 'Y'),
(5, 3, 4, 'Let us know a little more about you', 'name', 'The more you share about your profile, the more accurately our partners can assess your application and get you the best rate. We will never share your personal information without your explicit authorization.', '7ed8e42a2ba891cc230878124fe0fb5e.png', NULL, 'text', 'Y', '2019-01-16 12:05:47', '1', 'Y'),
(6, 4, 5, 'What is your email address?', 'email', 'We will NEVER share your contact information without your explicit authorization. No spam emails or third parties, ever.', '84d8d8b039809375e422457f1c29f558.png', NULL, 'text', 'Y', '2019-01-16 12:06:08', '1', 'Y'),
(7, 0, 6, 'Verify your email address', 'emailverification', 'Check your email & copy the verification code as provided to activate your account and continue the process to get a loan.', 'fb5cb7d3f5b4b13d5b8e7a359b2299ad.png', NULL, 'text', 'Y', '2019-01-16 12:06:35', '1', 'Y'),
(8, 4, 7, 'Almost done! Please create a password.', '', '', '28b8dea02ca3d02c977a02442374173f.png', NULL, NULL, 'Y', '2019-01-16 15:25:07', '1', 'Y'),
(9, 0, 8, 'Your account has been created successfully.', '', 'Great, Thanks for completing your registration!', 'cc290ff9ccb8be308cfa6868d7d36d17.png', NULL, NULL, 'Y', '2019-01-16 15:25:27', '1', 'Y'),
(10, 5, 9, 'New loan', 'newloan', '', '0d3540473e25a36e4561610ba3d18440.png', NULL, 'text', 'Y', '2019-01-16 15:25:47', '2', 'Y'),
(11, 7, 11, 'What is your date of birth?', 'dob', '', 'bf110e1ccc26e7b558b1aaf01ac35be2.png', NULL, 'text', 'Y', '2019-01-16 15:26:02', '2', 'Y'),
(12, 8, 12, 'What is your home address?', 'homeaddress', 'This is your permanent home address.', 'fe64fe9f6de1fdf589e556b150d79438.png', NULL, 'text', 'Y', '2019-01-16 15:26:23', '2', 'Y'),
(13, 9, 13, 'What is the address of the property that you need a new mortgage on?', 'propertyaddress', '', '7ceed246e2bc4ca077b3a118c8db7779.png', NULL, 'text', 'Y', '2019-01-16 15:27:58', '2', 'Y'),
(14, 11, 15, 'What is your approximate home value?', 'homevalue', 'Most lenders will require a formal appraisal - try to be honest and accurate now, it will save you time later.', 'ed0fe7c51b163a51974432234b2d98ea.png', NULL, 'text', 'Y', '2019-01-16 15:28:13', '2', 'Y'),
(15, 4, 16, 'What is your phone number?', 'phone', '', '4b1cc67649d4871aef77f8eab2ba2b97.png', NULL, 'radio', 'Y', '2019-01-16 15:28:49', '2', 'Y'),
(16, 16, 21, 'Do you have any other loans/mortgages/helocs on the property that you\'re looking to finance?', 'anotherloan', 'Tip:  If you have a line of credit, it might be secured against your property!', 'd8c9321a707c632a1c0f1ac83f8a724e.png', NULL, 'text', 'Y', '2019-01-16 15:30:35', '2', 'Y'),
(17, 6, 10, 'Loan term', 'loanterm', 'How long do you need the money for?  Most mortgages on RateCo.ca are for 12 months.', 'a91000a07116dd699c5e3548ad14dba8.png', NULL, 'text', 'Y', '2019-01-16 15:34:08', '2', 'Y'),
(18, 12, 17, 'What is your job title?', 'jobtitle', '', 'bed10fd086cb62e9c659362e0747c909.png', NULL, 'text', 'Y', '2019-01-16 16:45:47', '2', 'Y'),
(19, 15, 20, 'What is your annual income before tax?', 'annualsalary', '', '92d38311cf027b4e784e0a1346ad7497.png', NULL, 'text', 'Y', '2019-01-16 16:46:20', '2', 'Y'),
(20, 18, 23, 'Terms & Conditions', 'termsconditions', '', '7c32b309267903ccab02abbe76d0c0d3.png', NULL, 'text', 'Y', '2019-01-16 16:46:50', '2', 'Y'),
(21, 19, 24, 'Your loan request has been submitted successfully', 'success', 'Thank you for completing our application; a licensed Rateco.ca Agent will be in touch as soon as possible!  Our online lender auctions begin at 11am every business day.', 'd92e443ab1dce7c311730cda97cb0f36.png', NULL, 'text', 'Y', '2002-01-01 04:43:07', '2', 'Y'),
(22, 13, 18, 'Please enter the name of your Employer', 'employer', '', '0a8f70cae19271e759f897a33f518f31.png', NULL, NULL, 'Y', '2019-02-25 07:20:42', '2', 'Y'),
(23, 14, 19, 'Please enter the first and last name of your spouse <br>(if applicable)', 'spouse', '', '7e0758f7f070f79043d49a061ae550dd.png', NULL, NULL, 'Y', '2019-02-25 07:21:51', '2', 'Y'),
(24, 10, 14, 'What type of property is this?', 'housetype', 'Different lenders lend on different types of homes and properties, so this helps us match you to the right lender. If you\'re unsure, ask us!', '', NULL, 'radio', 'Y', '2019-02-25 07:23:50', '2', 'Y'),
(25, 17, 22, 'LTV calculations', 'ltv_calculation', 'LTV stands for Loan to Value. This helps us determine what percentage of the equity in your house is already secured with debt.', '4e6529514b3d03d57729762757d27985.png', NULL, NULL, 'Y', '2019-02-25 07:29:35', '2', 'Y');
