(11, 'GTA', 'gta', '<p>Your use of this Web site, and of the services of Rateco, Inc. (&ldquo;Rateco&rdquo;), is at your own risk. Rateco is exempted from all liability or potential liability relating to your use of the information or content of this Web site, including but not limited to any damages, losses or expenses of any kind arising from or in connection with this Web site or its use or any person&#39;s inability to use the site, or in connection with any failure of performance, error, omission, interruption, defect, delay in operation or transmission, computer virus or line or system failure, loss of data or otherwise, even if Rateco is advised of the possibility of such damages, losses or expenses. Users should conduct their own investigations, analysis, due diligence, draw their own conclusions, and make their own decisions, and seek their own independent legal advice in conjunction with any lending product recommended by Rateco.&nbsp;</p><p>The user further acknowledges and agrees that Rateco does not assume and hereby disclaims any liability to any party for any loss or damage caused by the use of the information or documents contained herein or errors or omissions in the information contained in this document to make any investment decision, whether such errors or omissions result from negligence, accident or any other cause. Rateco uses reasonable efforts to furnish accurate and up-to-date information on this Web site but does not warrant its accuracy, adequacy, timeliness or completeness.&nbsp;</p><p>This Web site is for informational or illustrative purposes only. You should always seek personalized advice from qualified professionals before making any banking, finance, investment, insurance or financial planning decisions based upon any information provided on or though the Web site. Rates, fees and other information is subject to change at any time without notice to users and the posted rates and fees on the site may not immediately reflect such changes. Any lender product information contained herein is subject to change and is entirely at the discretion of the lender.&nbsp;</p><p>No endorsement of any third party products, services or information is made or implied by any information, material or content referenced or included on, or linked from or to this Web site. This document and all material herein are the property of Rateco. No copies or portions thereof may be reproduced via electronic or other form or medium made be produced or used without prior written consent of Rateco. Errors and omissions excluded. Privacy Policy - Last Update Feb 12, 2019 At Rateco.ca, we understand that privacy is a critical issue for our clients.&nbsp;</p><p>This policy outlines the principles Rateco.ca applies when protecting users&#39; privacy, and outlines the principles and commitments we make to you, our client, to protect the privacy of your personal information. This policy does not apply to the information collected, used or disclosed with respect to corporate or commercial entities that are clients. However, Rateco exercises the same care and diligence in protecting the confidentiality of this information.&nbsp;</p><p>1. Rateco is accountable for the protection of clients&#39; personal information. While senior management is ultimately accountable for the protection of personal information, the day-to-day monitoring for compliance may be delegated to other staff.&nbsp;</p><p>2. Rateco is committed to ensuring that the appropriate security measures are employed in the transfer of sensitive information. However, when using e-mail or wireless communication, Rateco advises clients that complete confidentiality and security can not be assured.&nbsp;</p><p>3. Rateco is not accountable for any damages suffered when a client transmits personal information through e-mail or wireless communication or when Rateco transmits information at the request of the client.&nbsp;</p><p>4. Rateco has developed policies and procedures to: protect personal information; receive and respond to complaints and inquiries; train staff regarding the policies and procedures; and communicate the policies and procedures to our clients.&nbsp;</p><p>5. Rateco collects client personal information for the following reasons only: To provide financial services; To understand their clients&#39; financial needs; To facilitate the offering of third party complimentary products or services; To broker and administer loan agreements; To develop, manage and deliver products and services to clients; To develop and deliver marketing and promotional offers to clients; To determine client eligibility for different products and services; To ensure that clients receive a high standard of service; To meet regulatory requirements; To manage and transfer the assets and liabilities of Rateco.ca and those assets under its administration; and, To verify client&#39;s identity. Rateco.ca will only collect personal information for the purposes identified. Rateco.ca will use methods that are lawful and will not collect information indiscriminately. Rateco.ca will not use personal information for any additional purpose unless Rateco.ca seeks client consent to do so.</p><p>6. Rateco.ca will obtain client consent to collect, use or disclose any personal information except where detailed in this policy. Rateco.ca will make reasonable efforts to ensure that clients understand how their personal information will be used and disclosed.&nbsp;</p><p>7. A client&#39;s consent can be express, implied, or given through an authorized representative such as a lawyer, agent or broker. Consent may be given orally, in writing, or electronically. For example, depending on the sensitivity of the information, consent can be expressed over the telephone when information is being collected; electronically when submitting an agreement, application, or other information; in writing when signing an agreement or application form. Implied consent exists when Rateco.ca can reasonably infer consent based upon the action or inaction of the client.&nbsp;</p><p>8. Rateco.ca, however, may collect, use or disclose personal information without the client&#39;s knowledge or consent in exceptional circumstances: When such collection, use or disclosure is permitted or required by law When certain information is publicly available When we require legal advice from a lawyer When we need to collect a debt from a client When we need to deal with an anticipated breach of law When potential investors/stakeholders wish to ensure the quality and characteristics of an investment.&nbsp;</p><p>9. Subject to contractual or legal arrangements, clients may withdraw or refuse consent provided that Rateco.ca is given reasonable notice. Rateco.ca may decline to deal with a client or person who will not consent to the use of such information.&nbsp;</p><p>10. Rateco.ca may periodically use client personal information to conduct client surveys in order to enhance our provision of services or products. If an outside body is employed to conduct research on behalf of Rateco.ca, or provide other services that require access to client information, Rateco.ca will ensure that appropriate security undertakings, such as confidentiality clauses in contractual arrangements, are employed to protect the transfer and use of personal information.&nbsp;</p><p>11. Rateco.ca will retain client personal information only as long as necessary or expected to be necessary for the identified purposes, or as required by legislation.&nbsp;</p><p>12. Rateco.ca may disclose personal information related to a financial asset of Rateco.ca along with transfer of the financial asset.&nbsp;</p><p>13. Rateco.ca will make reasonable efforts to ensure that client personal information is as accurate. In some cases, Rateco.ca relies on its clients to ensure that certain information, such as the client&#39;s address or telephone number, is current, complete, and accurate.&nbsp;</p><p>14. Rateco.ca will not routinely update information unless it is necessary to fulfill the purposes for which it was collected or if it is required to maintain an active account.&nbsp;</p><p>15. Rateco.ca is committed to the safekeeping of client personal information in order to prevent its loss, theft, unauthorized access, disclosure, duplication, use, or modification, and will employ appropriate security measures to protect the information. The measures may include, for example, the physical security of offices and data, and electronic security measures such as passwords and encryption where appropriate.&nbsp;</p><p>16. Rateco.ca will use appropriate security measures when disposing of client personal information.&nbsp;</p><p>17. The development of Rateco.ca&#39;s policies and procedures for the protection of personal information is an ongoing process. Changes in technology necessitate that Rateco.ca continually develops, updates, and reviews information protection guidelines and controls to ensure ongoing information security.&nbsp;</p><p>18. Rateco.ca will make the following information available: The name, title and address of the person accountable for the policies and procedures and to whom complaints or inquiries can be forwarded; A description of the type of personal information held by Rateco.ca, including a general account of its use; A copy of any brochures or other information that explain the policies and procedures; and An explanation of what personal information is made available to affiliated companies or investors.&nbsp;</p><p>19. Clients have a right to access their personal information held by Rateco.ca. Upon request, Rateco.ca will, within a reasonable time period, tell the client what personal information it has, what it is being used for, and to whom it has been disclosed if applicable and within the time period for which records are available.&nbsp;</p><p>20. Clients may be asked to be specific about the information they would like to access and to submit their request in writing to Rateco.ca.&nbsp;</p><p>21. Clients will be required to provide personal information to identify themselves to enable Rateco.ca to provide an account of the existence, use, and disclosure of personal information.&nbsp;</p><p>22. Rateco.ca will make the information available within 30 days, or provide written notice of extension where additional time is required to fulfill the request. When information is not provided within 30 days of the request, Rateco.ca will, no later than 30 days after the date of the request, send a notice of extension to the client, advising of the new time limit, the reasons for extending the time limit and of the right of the client to make a complaint regarding the extension.&nbsp;</p><p>23. If a request is refused, Rateco.ca will notify the client in writing, documenting the reasons for refusal and resources for redress available to the client.&nbsp;</p><p>24. The information will be made available at a cost that will vary with the type and amount of information requested. Where the client will incur a cost, Rateco.ca will inform the client of the cost and request further direction from the client on whether or not Rateco.ca should proceed with the request.&nbsp;</p><p>25. In certain situations, Rateco.ca may not be able to provide access to any or all personal information about a client. In such cases, Rateco.ca will explain the reasons it will not provide the requested information, and identify resources for recourse available to the client. The reasons for not providing information may include that it is unreasonably costly to provide, information that would threaten the life or security of another individual, information generated in a formal dispute resolution process, information that contains references to other individuals, information that cannot be disclosed for legal, security, or commercial proprietary reasons, and information that is subject to solicitor-client or litigation privilege.&nbsp;</p><p>26. If the information is demonstrated to be inaccurate or incomplete, Rateco.ca will amend the information as required. Where appropriate, Rateco.ca will transmit the amended information to Third Parties having access to the information in question.&nbsp;</p><p>27. Clients are to direct any complaints, concerns or questions regarding this privacy policy in writing to the Compliance Officer. At any point in this process the client may also write to the Privacy Commissioner.&nbsp;</p><p>28. Clients may withdraw consent at any time, subject to legal or contractual restrictions, provided that reasonable notice of withdrawal of consent is given to the Rateco.ca. On receipt of notice of withdrawal of consent, Rateco.ca will inform the individual of the likely consequences of the withdrawal of consent, which may include the inability of Rateco.ca to provide certain products or services, if the information is necessary to provide the products and services.&nbsp;</p><p>29. To improve the usability of our website at www.rateco.ca, we capture information about how users interact with our site and what pages they visit. No personal information is collected as part of this process. The data we collect is used internally to better understand and support our users.</p>', 'Y', '2019-01-16 12:38:23', 1),
