INSERT INTO `rateco_email_template` (`email_template_id`, `email_title`, `email_slug`, `email_subject`, `email_message`, `email_status`, `create_datetime`, `email_isshow`) VALUES
(1, 'Lender Auction Closed', 'auction_ended', ' [AUCTION_ENDDATE] \'s Auction on Rateco.com has Closed', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:left;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Auction Closed.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hello [LENDER_NAME],<br><br>This is to inform you that the Auction for [LOAN_REF_ID], dated [AUCTION_ENDDATE], has been completed.<br><br>We are now awaiting Borrower Bid Selection and will inform you if any further actions are required.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-12 10:28:59', 'Y'),
(2, 'First Bid Received', 'first_bid', 'Your Loan Just Received its First Bid on Rateco', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Auction Opening.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hello [BORROWER_NAME],<br><br>This is to inform you that the loan you submitted to auction on Rateco just received its first bid! The auction is set to close at [AUCTION_CLOSE_TIME] on [AUCTION_CLOSE_DATE]; if you want to check in and watch Lenders bid on your application, click link below:<br><br><a href=\"[CHECK_LINK]\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">Click Here.</a><br><br><br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-11 14:52:27', 'Y'),
(3, 'Auction Opening', 'auction_started', 'New Auctions are starting on Rateco.com', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Auction Opening.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hello [LENDER_NAME],<br><br>New Auctions are starting at [AUCTION_STARTDATE] on Rateco. You have Bid opportunities available.<br><br>To begin bidding, please click on the link below:<br><a href=\"[CHECK_LINK]\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">Bid Now.</a><br><br><br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-11 15:06:09', 'Y'),
(4, 'Your Auction Has Closed', 'auction_completed', 'Check out your Rate Offer on Rateco', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:left;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Your Auction Has Closed.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:50px 15px 50px; max-width:540px; min-height:100px; text-align: left;\">Hello [BORROWER_NAME],<br><br>The Auction that has been running on Rateco.com is Closed on [AUCTION_COMPLETE_DATE]. Your Rateco Agent, [CSR_NAME], will be contacting you shortly to walk you through the offers. But you can go in and have a look right now! Just click the link below:<br><br>Loan Request: <a href=\"[CHECK_LINK]\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\"># [LOAN_REQUEST_REF].</a><br><br><br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-12 12:14:21', 'Y'),
(5, 'Winning Bid', 'notification_due_diligence', 'Congratulations! You have the Winning Bid on Rateco.com!', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Winning Bid</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hello [LENDER_NAME],<br><br>We&#39;re pleased to inform you that your provisional offer for Loan [LOAN_REQUEST_REF] has been accepted by the Borrower.<br><br>To proceed, please return to Rateco.com to ensure that any due diligence documentation required has been set against this loan opportunity; we will begin collecting all documents from the Borrower and scheduling an appraisal, if one is required.<br><br>To view the documents you have requested, please <a href=\"[CHECK_LINK]\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">click here</a><br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-12 12:21:43', 'Y'),
(6, 'Login Notification', 'login_notification', NULL, NULL, 'N', '2019-01-12 12:38:56', 'N'),
(7, 'Two-factor authentication', 'two_factor_authentication', NULL, NULL, 'N', '2019-01-12 15:14:59', 'N'),
(8, 'Forgot Password', 'forgot_password', 'Rateco.com Password Reset', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:30px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Password Reset</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:50px 15px 50px; max-width:540px; min-height:100px; text-align: left;\">Dear <strong>[NAME],</strong><br><br>Your password has been reset.<br><br>Email Address : [EMAIL_ID]<br>Password : [PASSWORD]<br><br>Please change your password after login.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-12 15:21:35', 'Y'),
(9, 'Password created successfully', 'sign_up_notification', 'Password created successfully', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>&nbsp;Password created successfully.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:50px 15px 50px; max-width:540px; min-height:100px; text-align: left;\">Hello [FIRST_NAME],<br><br>This is to let you know that you have successfully created a username and password for Rateco.com to continue.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-12 15:28:10', 'Y'),
