(13, ' Contact Us Inquiry', 'contact_email', 'Contact Message from RateCo', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>&nbsp;Contact Us Inquiry.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hi Admin,<br>You have received a new message.<br><br>Name : [NAME]<br>Phone : [PHONE]<br>Email : [EMAIL]<br>Message : [CONTENT]<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-12 18:12:43', 'Y'),
