(15, 'Document submissions approved', 'document_approved', 'Document submissions approved', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>&nbsp;Contact Us Inquiry.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hello [BORROWER_NAME],<br><br>This is to let you know that the documents you submitted to us for your Loan [LOAN_REQUEST_REF] have been accepted. No further action is needed at this time; we&#39;ll let you know when the Lender is ready to present you with their final decision<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-12 18:33:19', 'Y'),
(16, 'Commitment Letter', 'commitment_letter_uploaded', 'Commitment Letter for your Loan', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>&nbsp;Commitment Letter.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hello [BORROWER_NAME],<br><br>This is to let you know that the Lender has uploaded their Commitment Letter in respect of your Loan [LOAN_REQUEST_REF]. To review your Commitment Letter, please <a href=\"[CHECK_LINK]\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">click here</a>. If you have any questions at all, please contact your Agent, [CSR_NAME].<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-01-14 15:32:46', 'Y'),
