(20, 'Rateco Credentials - Password Reset', 'lender_contact_email', 'Rateco Credential - Password Reset Request', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>&nbsp;Rateco Credentials - Password Reset.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:50px 15px 50px; max-width:540px; min-height:100px; text-align: left;\">Hello [LENDER_CONTACT_NAME],<br><br>As per your request, we have reset your password for your account on Rateco.com.<br><br>Here is your temporary password: [LENDER_PASSWORD]<br><br>To input a permanent password, please click the link below and follow the instructions on the screen that follows.<br><br><a href=\"https://rateco.com/ratecohome/login\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">Click to reset password.</a><br><br>Many thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-07 11:50:42', 'Y'),
(21, 'Send Email to Manager Or CSR During Creation', 'csr_manager_email', 'Welcome to RateCo CSR access', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:30px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Welcome [CSR_MANAGER_NAME]</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:50px 15px 50px; max-width:540px; min-height:100px; text-align: left;\">Congratulations in being a part of Rateco.<br><br>The Administrator has created a profile on your behalf with the following details as below<br><br>Email Address : [CSR_MANAGER_EMAIL]<br>Password : [CSR_MANAGER_PASSWORD]<br><br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-08 05:35:53', 'Y'),
(22, ' New borrower application has been received', 'allocate_csr_to_loan', 'New borrower application has been received and assigned to you', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Loan assigned to you.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:50px 15px 50px; max-width:540px; min-height:100px; text-align: left;\">Hi <strong>[CSR_NAME]</strong>,<br>A new application has been completed and assigned to you.<br><br>Loan #: [LOAN_REQUEST_REF]<br>Borrower Name: [BORROWER_NAME]<br>Borrower Phone Number: [BORROWER_PHONE]<br>Borrower Email: [BORROWER_EMAIL]<br><br>Please reach out to this Borrower to assess their needs within the next 1 business day.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-08 12:48:00', 'Y'),
(23, 'Thank you', 'thank_you_message_contact_form', 'Thank you', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>&nbsp;Hello [NAME]</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Thank you for your message. A member of our team will review your message as soon as possible and will respond accordingly.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-09 11:40:10', 'Y'),
(24, 'Lender Thank you!', 'become_a_lender_thank_you_message', 'Thank you for your interest in Rateco.com!', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:10px 0; text-align:center;\"><strong>Thank you</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 10px auto; padding:5px 10px 5px; max-width:540px; min-height:100px; text-align: left;\">Hello [NAME],<br><br>Thanks for your interest in joining Rateco as a Lending Partner. A member of our leadership team will reach out to you to discuss a partnership as soon as possible.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-09 13:19:24', 'Y'),
(25, 'Lender Application to Participate', 'become_a_lender_contact_form', 'Lender Application - Submission from Rateco.com', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Lender Application to Participate.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hello Admin,<br><br>Contact message from Become a Lender RateCo. Contact details bellow.<br><br>Name : [NAME]<br>Company Name : [COMPANY_NAME]<br>Company Email : [COMPANY_EMAIL]<br>Company Phone : [COMPANY_PHONE]<br>Message : [CONTENT]<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-09 13:19:24', 'Y'),
(26, 'CSR - Auto generated password', 'send_password_to_csr', 'Password Reset', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:30px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Welcome [CSR_NAME]</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:50px 15px 50px; max-width:540px; min-height:100px; text-align: left;\">Dear <strong>[CSR_NAME],</strong><br><br>The Administrator has changed your password on your behalf with the following details as below<br><br>Email Address : [CSR_EMAIL]<br>Password : [CSR_PASSWORD]<br><br>Please change your password after login.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-18 10:54:48', 'Y'),
(27, 'Admin - Forgot password', 'admin_forgot_password', 'Password Reset', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:30px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Password Reset</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:50px 15px 50px; max-width:540px; min-height:100px; text-align: left;\">Dear <strong>[NAME],</strong><br><br>Your password has been reset.<br><br>Email Address : [EMAIL_ID]<br>Password : [PASSWORD]<br><br>Please change your password after login.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-19 06:26:02', 'Y'),
(28, 'Next steps - document collection', 'notification_due_diligence_borrower', 'Documents required for your loan application', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Borrower has selected winning bid.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hello <strong>[BORROWER_NAME],</strong><br><br>Now that you have selected a winning bid, your Lender has requested some documents to complete their due diligence for Loan Reference #[LOAN_REQUEST_REF] and confirm their offer to you.<br><br>To check and upload the documents directly to Rateco.com, please click the following link: [CHECK_LINK].<br><br>All documents should be in .pdf, .docx, or .xls formats. Please feel free to contact your Agent, [CSR_NAME], if you have any questions.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-25 13:45:47', 'Y'),
(29, 'Borrower has selected winning bid', 'notification_due_diligence_csr', 'A borrower has selected a winning bid', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Borrower has selected winning bid.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hi <strong>[CSR_NAME],</strong><br><br>[BORROWER_NAME] has selected a winning bid from the Auction for #[LOAN_REQUEST_REF].<br>Please contact the Borrower as soon as possible, if you have not already done so.<br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-25 13:45:47', 'Y'),
(30, 'Rateco.com - Email Verification and Password Input', 'Email_Verification_and_Password_Input', 'Rateco.com - Email Verification and Password Input', '<p>.</p><div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>Auction Opening.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Welcome [LENDER_CONTACT_NAME],<br><br>Hello [LENDER_CONTACT_NAME], welcome to Rateco.com! As per your company&#39;s request, we have established you as a contact person for the [LENDER_NAME] account, and have provided you with temporary login credentials:<br>Username: [LENDER_CONTACT_EMAIL]<br>Password: [TEMPORARY_PASSWORD]<br><br>In order to input a permanent password, please click the link below and follow the instructions on the screen that follows.<br><br><a href=\"[CHECK_LINK]\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">Click Here.</a><br><br>Thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-26 07:35:59', 'Y'),
(31, 'Borrower Contact Password Update', 'borrower_password_generate', 'Rateco.com - Password Reset', '<div style=\"max-width:600px; margin:0; background-color: #ffffff; border: 1px solid #c8cace; border-radius:4px; padding:0px 0 15px;\"><a href=\"https://rateco.ca\" rel=\"noopener noreferrer\" style=\"display:block; text-align:center;\" target=\"_blank\"><img alt=\"\" src=\"https://rateco.com/images/logo.png\" class=\"fr-fic fr-dib\" height=\"80\"></a><p style=\"font: 17px/20px Helvetica, Arial, sans-serif; color: #ffffff; background:#15B5E6; padding:25px 0; text-align:center;\"><strong>&nbsp;Rateco Credentials - Password Reset.</strong></p><p style=\"color: #303030; font: 15px/20px Helvetica, Arial, sans-serif; margin: 25px auto; padding:20px 15px 20px; max-width:540px; min-height:100px; text-align: left;\">Hello [BORROWER_NAME],<br><br>As per your request, we have reset your password for your account on Rateco.com.<br><br>Here is your temporary password: [PASSWORD]<br><br>To input a permanent password, please click the link below and follow the instructions on the screen that follows.<br><br><a href=\"https://rateco.com/ratecohome/login\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">Click to reset password.</a><br><br>Many thanks,<br><a href=\"https://rateco.com\" rel=\"noopener noreferrer\" style=\"color:#15B5E6; text-decoration:none; font-weight:bold;\" target=\"_blank\">The Rateco team</a></p></div>', 'Y', '2019-03-26 09:44:50', 'Y');
INSERT INTO `rateco_faq` (`faq_id`, `faq_question`, `faq_answer`, `faq_status`) VALUES
(1, 'How does Rateco Work?', 'Have you been rejected by the banks? Need help financing the purchase of your home, consolidating your debts, or investing in a new property, and you don\'t know where to turn? We built Rateco to help you!\r\nRateco is a mortgage brokerage - but then again, we\'re not your typical brokerage. Ratec\'s \'reverse auction\' encourages lenders to bid against each other to win your business, with full transparency. And as this reverse auction unfold in real-time, you can literally watch yourself save money as rates get pushed down!\r\n', 'Y'),
(2, 'What is a second mortgage?', 'A home equity loan that allows homeowners to borrow money from the equity in their home, without refinancing their current mortgage. Second Mortgages carry higher interest rates than first mortgages. There are many reasons why you might need a second mortgage - maybe you want to buy an investment property? Refinance your other debts to a lower interest rate? A second mortgage borrows against the equity tied up in your home, allowing you to use the funds for other purposes.', 'Y'),
(3, 'Is a Heloc the same as a second mortgage ', 'A HELOC (Home Equity Line of Credit) is sometimes referred to as a second      mortgage because it is secured by your property, just like your original (first) mortgage. HELOC\'s are offered by many financial institutions, including chartered banks, and you can use the funds on offer to accomplish the same goals as you would with a second mortgage (such as investments, debt consolidation, renovations, etc). If you have applied for a HELOC from a chartered Canadian bank, and been denied, Rateco.ca can help you secure competitive rates on a HELOC from reputable Canadian private lenders.', 'Y'),
(4, 'Does my bank offer second mortgages?', 'Most banks offer a second mortgage product for suitable clients. However, most banks also want to ensure that a home has significant equity before they\'ll consider approving a second mortgage. Before the market crash of 2008, a borrower could get a second mortgage exceeding 100% of their home\'s market value; today, banks want tangible security, appraised and backed by solid equity for such loans. As these loans have become harder to secure and more expensive to pay back, more and more borrowers are finding that their banks do not provide an adequate loan amount, or a reasonable rate or terms. All the more reason to work with Rateco.ca, where lenders compete to offer you the lowest possible rate on private, non-bank mortgages.', 'Y'),
(5, 'Is a private mortgage safe?', 'There are definitely higher risks associated with private lending for both lender and borrowers; it is important for borrowers to understand who they are securing a loan from, precisely what terms are associated with the loan, and whether the lender is reputable and/or regulated (and if regulated, by what entity). Private lending can come from: \r\na) an individual with capital that they want to invest to earn interest, or \r\nb) organizations such as Mortgage Investment Corporations (MIC\'s), essentially pools of capital invested by private individuals to be deployed by professional underwriters. Neither private individuals or MIC\'s are regulated in Canada in the way that a bank is; while various government entities regulate banks, credit unions and \'alternative\' lenders, private individuals are self-regulated and seek to ensure only that they manage default risk on the loans they issue. MIC\'s are regulated by provincial regulatory bodies and must consider the needs and financial capacity of their borrowers when issuing a loan. Having professional management and large pools of capital to draw on, an MIC is, by nature, a safer source of financing than a private individual; but the onus is always on the borrower, and brokers like Rateco.ca, to ensure that the borrowers\' needs are being appropriately considered before a source of funds is secured.', 'Y'),
(6, 'Who exactly are private lenders?  Are they \'loan sharks\'?', 'Private mortgage lenders are generally a small company or individual who provides mortgages to borrowers for their own personal benefit. They view high risk borrowers/properties as investment opportunities, and may provide capital to borrowers that have no access to credit through more traditional lending institutions. As a result, a relationship between a borrower and a private lender can be beneficial for both parties. At Rateco.ca, we partner with Mortgage Investment Corporations, small investment firms that take capital from high-net-worth investors and seek to fund mortgages on Canadian properties, creating a solid return for their investors.', 'Y'),
(7, 'Can a private lender take over my home without my knowing?', 'Like your first mortgage the second mortgage is secured by your property.  The reason the mortgage is known as a second mortgage is that the lender\'s security is actually behind the first mortgage.  If you were to default on the conditions of your mortgage, for example, you didn\'t make a payment, then the lender will typically work with you to bring your mortgage up to date.  Failing to do so would then result in the mortgagee (the bank/lender) taking action to act on their security.  This is a process, and typically will only happen after multiple attempts to resolve the issue.   Keep in mind, the mortgagee is interested in making return from the money they have loaned out, they are not in the business of taking over your property and selling it.  In such situations, the lender incurs a lot of additional costs and paperwork.  They want to avoid this scenario.   It is always important to read the commitment letter and mortgage documents prior to signing them, to fully understand your rights. ', 'Y'),
(8, 'Are there hidden costs or hidden fees buried in my mortgage? What do I need to watch out for?', 'Hidden costs do exist in this industry and may include processing fees, underwriting fees and base origination fees. These fees alone can add up to 2% to your cost of borrowing and are often negotiable. Further, your private mortgage is all but certain to include a Broker Fee (Rateco.ca\'s standard Broker Fee is 1.5%, which is intentionally set below the rate charged by our competitors); a Lender Fee, and legal and appraisal fees. Non-negotiable fees can include; property taxes, insurance, other property related charges, transfer taxes and government recording charges.', 'Y'),
(9, 'How is RateCo.ca different than other Mortgage Brokers?', 'In a word, transparency. When we tell you that we have asked multiple lenders to bid on your deal, we mean it, and better yet, you can watch it happen, in real-time. We work hard to ensure you\'re never surprised and our CSR\'s are trained to be straight-up-honest with you throughout your time working with us. ', 'Y'),
(10, 'My Real Estate Agent said to use his broker', 'Always do your own research and compare brokers. Compare their interest rates, fees and always ask questions. We\'re confident that, when you compare offers received from other Brokers, with all of the affiliated fees considered, Rateco.ca\'s reverse auction model makes us very, very competitive!.', 'Y'),
(11, 'My Mortgage Broker said they can get me a better rate', 'They might be right! Rateco.ca is not for everyone - borrowers that are able to secure funds from Chartered Banks and other regulated financial institutions might very well be able to secure less expensive first- and second-mortgages. For those borrowers that, for a variety of reasons, are unable to secure a loan from a regulated lender, and must solicit funds from a private lender or MIC, Rateco.ca\'s reverse-auction model puts you in position to get the lowest fully-loaded rate, and most attractive terms, of any source in Canada.', 'Y'),
(12, 'Can I pay back my Rateco.ca-arranged mortgage early?', 'Generally speaking, second mortgages arranged by Rateco.ca are interest-only loans; that is, the borrower is only expected to service the interest charges on the loan during the term, and not to repay any of the principal until the end of the term (and even then, only if they haven\'t extended the term or rolled the expiring loan into a new loan). That said, some interest-only loans have \'open\' repayment terms, wherein the principal can be partially- or fully-repaid before the end of the term, with or without a penalty. Your Rateco.ca-appointed mortgage agent will walk you through this and other aspects of your loan options to ensure you get a product that is customized to your needs.\r\n\r\nHow does my credit get impacted because of a private loan?  While going through the RateCo.ca application process you will authorize RateCo to pull a credit report from Equifax.  This credit report will be used by our lenders to provide you the best interest rate for a mortgage, and any \'hard\' credit request may have negative implications on your credit score. ', 'Y'),
(13, 'Can I sell my house while I have a second mortgage?', 'There is no reason why a second mortgage should make the sale of your property any more difficult; the net proceeds of the sale would be used to repay the principal of the second mortgage, after the first mortgage has been repaid.', 'Y'),
(14, 'Can I renovate my home?', 'As with any mortgage, a lender may restrict the borrower from making significant renovations (generally, tear-downs of all or part of the residence, such that structural elements of the home are impacted) unless they have issued formal approval. Such restrictions would be set out as terms in the loan, and would be addressed between the borrower and their Rateco.ca - assigned mortgage agent.', 'Y'),
(15, 'Can the private lender get access to my house when I\'m not home? Do they have key?', 'ABSOLUTELY NOT! Whether a mortgage is issued by a bank or a private lender, your lenders never have the rights to access your home without your consent. Further, unless there is some reason for a lender to believe that your property has been impaired or is not being adequately maintained, it would be highly unusual for the lender to visit the physical premises at any time. ', 'Y'),
(16, 'When will I get my money for the second mortgage?', 'Once an auction has closed and you have selected your preferred lender, that lender will move into a formal due diligence process. While this timeline can vary, generally speaking, the faster you provide the list of documents that the lender is seeking, the faster the process can move. Once the lender receives all of your documentation and a formal appraisal of your property, you will sign the loan agreement, and will typically receive your funds within 5 business days thereafter. The only difference between Rateco.ca\'s process and that of other brokers is that with Rateco.ca, instead of getting a soft commitment immediately, you must wait 24 hours while lenders ACTUALLY bid for your business. ', 'Y'),
(17, 'I want to use the money to pay for my wedding? Can I do that? ', 'Once you have received the funds, unless there are specific restrictions on the use of your funds explicitly written into your loan agreement, you are free to use the funds for whatever you like!', 'Y'),
(18, 'Why is the interest rate so high on second mortgages and/or private mortgages? ', 'If you are seeking funds from a private lender or MIC, you have likely approached chartered banks, credit unions or larger alternative lenders, and were unable to secure the funds you require. These institutions are not able to provide the funds for a variety of reasons - government legislation, the risk profile of their loan portfolio, etc. As private lenders, our lender partners are able to be more flexible with their lending, but have a higher cost of capital, and higher risk that their loans will not be repaid. Consequently, they must charge significantly higher interest rates. If you have NOT already sought funds from an established bank or credit union, you are advised to do so before using the Rateco.ca reverse auction service.', 'Y'),
(19, 'What is the difference between an MIC and a private lender? ', 'Essentially, an MIC is a collection of private lenders, whose assets have been pooled together to be invested into mortgages. Pooling assets has a number of advantages for these investors - they can afford to hire professional underwriters to manage the loans and find borrowers; and they take on less individual risk by investing into a broader portfolio of loans. For the borrower, seeking funds from an MIC instead of a private lender is advantageous as well - with a large pool of capital, there is a much lower risk that the lender will need to \'call\' the loan and force you to repay before you\'re able.', 'Y'),
(20, 'What type of information will the lender ask for during due diligence?', 'Most lenders have standard diligence requirements for all potential borrowers; this typically includes:\r\n1.Last two pay stubs for each borrower\r\n2.IDs for each borrower (Drivers License / Passport / Etc)\r\n3.Property Tax Statement\r\n4.Proof of Home Insurance\r\n5.Confirmation of employment letter\r\n6.Listing on the Property (if it was purchased within the last year)\r\n7.An appraisal\r\n8.The Notice of Assessment, or NOA, for the most recent 1 - 2 years; your NOA is your composite tax filing with Revenue Canada\r\n9.Your Credit Report; Rateco arranges for this to be pulled automatically from Equifax at the time of your submission\r\n\r\nDepending on the lender and the specific terms or situation of your loan, you may be asked for additional items. A Rateco.ca Customer Service Representative will help you to compile these documents and to pass them through to your selected Lender so that they can conduct due diligence on your loan.\r\n', 'Y'),
(21, 'How do I know the RateCo.ca site is secure?', 'With reports of data breaches emerging almost daily, your skepticism and concern for your data protection is well-placed and can not be understated. The Rateco.ca platform has been built, from the ground up, with data protection at its core. Our Product team has built enterprise-level platforms to be acceptable to Canada\'s big-5 banks, and uses industry-leading encryption, secure components and on-site privacy policies to ensure we treat your personal information with the utmost care and concern. Feel free to email our team if you have any specific questions in respect of the site\'s architecture and we will be happy to reply.', 'Y'),
(22, 'Will RateCo make my name public? ', 'Absolutely not! None of your personal information will ever be shared with anyone, other than our approved set of lender partners. Further, none of your personal or anonymized data will ever be used for purposes outside getting you the loan you are seeking through us, except with your explicit permission.', 'Y'),
(23, 'Who do I payback on a monthly basis? RateCo?', 'Once Rateco.ca has introduced you to your lender partner, and helped you through the process of securing your loan, your payments will be sent directly to your lender partner. All of this will be arranged for you, and you can continue to call or email us here ar Rateco if you need any support.', 'Y'),
(24, 'How does RateCo.ca make money?', 'In a private mortgage, the Borrower pays a \'Broker Fee\' once their deal has been funded, so you are effectively paying us for the help we provided in finding you a source of financing. We want to stress that, in the private mortgage world, this is STANDARD - you can work with us, or another Broker, but you will be paying a Broker fee to somebody! When you work with Rateco.ca, you can be assured of the following:\r\n\r\n1.FULL TRANSPARENCY. No tricks, no hidden fees, and no discounts or side-deals. You find out upfront what Rateco is going to earn from your deal, and it is worked in to your APR and monthly payment calculations.\r\n\r\n2.A BETTER RATE THAN ANYONE ELSE! All of our borrowers pay us 1.5% of the gross amount of their mortgage. This is well below standard industry rates, which typically range from 2% to 5%.\r\n\r\n3.A BETTER PRIVATE MORTGAGE. Let\'s not forget that when you work with Rateco.ca, our Lenders actually bid against each other, in real time, to provide you with the best possible terms on your loan. So you get a lower Broker Fee from us, AND a lower interest rate then you\'re likely to get anywhere else. \r\n', 'Y'),
(25, 'How long will it take for me to get an approval? ', 'When you actually get an approval and receive your funds will depend on a number of variables - how straightforward is your application, how accurate were you when you self-reported your earnings, etc. This is true whether you work with Rateco, or another Broker; most approvals should be formalized within 5 business days. In order to expedite your mortgage funding as much as possible, you should work closely with your Rateco Customer Service Representative to gather all requested due diligence materials quickly (and even before a Lender has asked for them) so that they can make a funding decision as quickly as possible.', 'Y'),
(26, 'When do I know that I am getting the money?', 'There are a number of ways that you will be alerted that your deal is being funded. Our Lenders will update the status of your loan application in the platform; you will receive an email and may also receive a phone call from a Rateco CSR; or your lawyer will advise you. ', 'Y'),
(27, 'Does my bank find out that I have second mortgage?', 'Your bank may find out about a second mortgage at various times, though typically only when you are seeking to renew or refinance your mortgage with them, or in seeking additional credit products. Unless there is language in the first mortgage that prevents the addition of a second, your bank likely will not care about the presence of a second mortgage, as they remain ahead of the second mortgage in the repayment prioritization.', 'Y'),
(28, 'Can I use the equity in my house to invest in stocks? Or buy other real estate?', 'Absolutely. Your Lender may inquire as to the use of the proceeds of the mortgage (and they may not); as long as you are not breaking any of the terms set out in your commitment letter, you are free to use the proceeds as you wish.', 'Y'),
(29, 'Can you help me refinance my first mortgage as well? ', 'Yes; when you apply to Rateco.ca for a loan, and it is determined that a private second mortgage is not the right product for you, Rateco can work with you to establish how best to address your needs, including a first mortgage, a refinance, or shorter-term / intermediate options', 'Y'),
(30, 'Do you do mortgages in the US?', 'No. Rateco will work with international borrowers but only in respect of Canadian properties.', 'Y'),
(31, 'Why is the lender asking me about home insurance? ', 'Your lender is offering you a second mortgage, and using the value of your property as collateral. As a result, the value of your home is of the utmost importance to the Lender, and they will want to make sure that your home is adequately insured against loss.', 'Y'),
(32, 'Do I need a cosigner?', 'A second mortgage does not require you to co-sign with any other party. If your personal financial situation is such that you do not qualify for the mortgage, your Lender may suggest adding a co-signer to the loan to improve the financial health of the application.', 'Y'),
(33, 'I don\'t have a job; can I still qualify? ', 'Rateco.ca works with many borrowers who are self-employed and unemployed. Traditional banks will likely penalize potential borrowers who can not demonstrate gainful employment; the private lending market focuses largely on the value of your home as collateral against the loan, meaning you may be able to receive funds without traditional employment.', 'Y'),
(34, 'I am a senior citizen - can you help me get a mortgage?', 'Absolutely! At Rateco, we often work with homeowners who just don\'t fit with a bank\'s lending model. While banks are most comfortable lending to individuals with good jobs and income, private lenders base their lending decisions on the value of your home, making them more willing to consider applications from other types of borrowers, including senior citizens on fixed income with ample equity tied up in their homes.', 'Y'),
(35, 'I\'m new to the country? Can I get a mortgage?', 'Absolutely! At Rateco, we often work with homeowners who just don\'t fit with a bank\'s lending model. While banks are most comfortable lending to individuals with good jobs and income, private lenders base their lending decisions on the value of your home, making them more willing to consider applications from other types of borrowers. If you\'re new to Canada but already own property, Rateco should be able to help you get a mortgage.', 'Y');
