INSERT INTO `rateco_hwitwrks_article` (`hwitwrks_article_id`, `hwitwrks_art_cat_id`, `hwitwrks_art_title`, `hwitwrks_art_img`, `hwitwrks_art_slug`, `hwitwrks_art_metakeyword`, `hwitwrks_art_metadescription`, `hwitwrks_art_description`, `hwitwrks_art_created_by`, `hwitwrks_art_created_date`, `hwitwrks_art_status`, `order_id`) VALUES
(2, 2, 'Fill Out your <strong>application</strong>', 'd6ff8649f5e47a965cd8c54ccb098104.png', 'article-2', 'test', 'test', '<p>First we need to know all about you and your mortgage needs. How much money are you looking for? What&#39;s your current financial position? With so many products and lenders available to us, we know we can find a product that fits you perfectly!</p>', 1, '2019-02-13 18:00:28', 'Y', 2),
(4, NULL, 'Rateco reviews your <strong>application</strong>', '2d78fa0194a56c8d795db6b166f15ebd.png', 'Rateco verifies your <strong>information</strong>-vyiespxzdc', NULL, NULL, '<p>Next, our licensed Mortgage Agents get in touch to hear it from you directly. They can help determine if you are eligible for a bank loan, a loan from another institution, or are suitable for a Rateco.com Private Mortgage Lender Auction!</p>', 1, '2019-02-26 01:15:49', 'Y', NULL),
(5, NULL, '<strong>auction!</strong>', '4886d68c458de2c5231e00d8dc5e7db1.jpg', 'Pick best lender after <strong>auction</strong>-npxqrxhrzl', NULL, NULL, '<p>If you&#39;re suitable for a Private Mortgage, just sit back and watch. Over the next 24 hours, reputable Canadian Private Lenders will bid on your business. You can literally watch as you save money IN REAL-TIME!</p>', 1, '2019-02-26 01:21:31', 'Y', NULL),
(7, NULL, 'Select the best<strong>deal</strong>', 'dad41a6b2e5c1f37b13826a4134363c4.jpg', 'Provide requested <strong>documentation</strong>-acqewvldzo', NULL, NULL, '<p>Once the Auction closes, you and our Mortgage Agent will review all of the bids and see which one is most suitable for you!</p>', 1, '2019-02-26 01:29:51', 'Y', NULL);
