(1, 'Home', 'When Lenders Compete for your Mortgage', '', '', 'bad credit loans, mortgage broker, second mortgage, private mortgage lenders, refinance mortgage, home improvement loans, mortgage loan, loans no credit, get a loan with bad credit, private mortgage', 'Rateco\'s reverse-auction platform enables private lenders to bid against each other, providing you their best rate for all your mortgage needs. Apply today!', '', 'YOU WIN!\r\n', '', '', 1, '2019-01-12 10:27:28'),
(2, 'How it Works', 'How do I use Rateco to get a better deal?', 'Need a private mortgage? Rateco can help get you a better deal!', '', 'bad credit loans, mortgage broker, second mortgage, private mortgage lenders, refinance mortgage, home improvement loans, mortgage loan, loans no credit, get a loan with bad credit, private mortgage', 'Have private lenders bid to provide your loan in two streamlined steps. Complete our online application, get approved, and join the auction! Learn More Now ', '', '', '', '', 1, '2019-01-11 13:22:37'),
(3, 'Become A Lender', 'Become A Lender', '', '', 'private lending, private loans, private mortgage loan, provide loans, become a private lender, provide mortgage loans, how to be a private lender, become a lender\r\n', 'Fill out our online form and take the first step in joining our private mortgage auction. We\'ll be in touch shortly.', '', '<p>Become a lender &amp; start bidding on loans today! Fill out our online application and join our growing platform.</p>', '<p>Test</p>', '<p>Test</p>', 1, '2019-01-11 13:24:20'),
(4, 'Get a loan Page', 'Get a loan Page', '', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-01-11 10:48:13'),
(5, 'About Us', 'About Us', '', '2fd525bee11a7e4a288c0a9a28727cf7.jpg', 'bad credit loans, mortgage broker, second mortgage, private mortgage lenders, refinance mortgage, home improvement loans, mortgage loan, loans no credit, get a loan with bad credit, private mortgage', 'Rateco provides transparency & competition to private lending. Our auction system enables lenders to bid against each other, driving rates down. Learn More!', 'Dedicated to helping you make more informed decisions.', '<p>Founded in 2018, Rateco.com was built to bring transparency and competition to Canada&#39;s private mortgage lending market.&nbsp;</p><p>As the Canadian government moved to put the brakes on a housing market that is becoming unaffordable for many Canadians, homebuyers and owners found themselves shut out from working with more traditional lenders, like our &#39;big 6&#39; banks. Needing mortgage financing, these borrowers have been moving into the private lending market, usually at the advice of their Mortgage Agent. But unlike the prime side of the business, where posted rates are available for borrowers to consider their options, no &#39;<strong>marketplace of rates</strong>&#39; exists in private lending - borrowers don&#39;t have all the information they need to make informed decisions.&nbsp;</p><p><br></p>', '', '<p>That&#39;s where Rateco.com comes in. We want to build transparency, trust and competition into the private lending market and to become the obvious choice for borrowers fighting to save their money. At Rateco.com, we&#39;re happy to build a strong, profitable business - and even happier that we can do it by helping people along the way.</p>', 1, '2019-01-11 13:26:43'),
(6, 'Terms and Conditions', 'Terms and Conditions', '', '', 'bad credit loans, mortgage broker, second mortgage, private mortgage lenders, refinance mortgage, home improvement loans, mortgage loan, loans no credit, get a loan with bad credit, private mortgage', 'Rateco\'s reverse-auction platform enables private lenders to bid against each other, providing you their best rates for all your mortgage needs. Apply today', '', '<p dir=\"ltr\">Your use of this Web site, and of the services of Rateco, Inc. (&ldquo;Rateco&rdquo;), is at your own risk. Rateco is exempted from all liability or potential liability relating to your use of the information or content of this Web site, including but not limited to any damages, losses or expenses of any kind arising from or in connection with this Web site or its use or any person&#39;s inability to use the site, or in connection with any failure of performance, error, omission, interruption, defect, delay in operation or transmission, computer virus or line or system failure, loss of data or otherwise, even if Rateco is advised of the possibility of such damages, losses or expenses. Users should conduct their own investigations, analysis, due diligence, draw their own conclusions, and make their own decisions, and seek their own independent legal advice in conjunction with any lending product recommended by Rateco. The user further acknowledges and agrees that Rateco does not assume and hereby disclaims any liability to any party for any loss or damage caused by the use of the information or documents contained herein or errors or omissions in the information contained in this document to make any investment decision, whether such errors or omissions result from negligence, accident or any other cause.</p><p dir=\"ltr\">Rateco uses reasonable efforts to furnish accurate and up-to-date information on this Web site but does not warrant its accuracy, adequacy, timeliness or completeness. This Web site is for informational or illustrative purposes only. You should always seek personalized advice from qualified professionals before making any banking, finance, investment, insurance or financial planning decisions based upon any information provided on or though the Web site.</p><p dir=\"ltr\">In connection with your use of the Rateco platform and/or services, you hereby authorize Rateco to collect your personal information, including information that may be collected from third parties in reference to your personal credit history (namely, a credit bureau, such as Equifax or Transunion) or your estimated property value (namely, Teranet or some similar service), in order to provide you with Rateco&#39;s mortgage broker service. At no time will data collected about you or your property, whether provided by you or from another party, be shared with another party except as required to fulfill our mortgage broker services, or as you may otherwise explicitly authorize if required.&nbsp;</p><p dir=\"ltr\">Rates, fees and other information is subject to change at any time without notice to users and the posted rates and fees on the site may not immediately reflect such changes. Any lender product information contained herein is subject to change and is entirely at the discretion of the lender.</p><p dir=\"ltr\">No endorsement of any third party products, services or information is made or implied by any information, material or content referenced or included on, or linked from or to this Web site.</p><p dir=\"ltr\">This document and all material herein are the property of Rateco. No copies or portions thereof may be reproduced via electronic or other form or medium made be produced or used without prior written consent of Rateco.</p><p dir=\"ltr\">Errors and omissions excluded.</p>', '', '', 1, '2019-01-11 13:27:57'),
(7, 'Privacy Policy', 'Privacy Policy', '', '', 'bad credit loans, mortgage broker, second mortgage, private mortgage lenders, refinance mortgage, home improvement loans, mortgage loan, loans no credit, get a loan with bad credit, private mortgage', 'Rateco\'s reverse-auction platform enables private lenders to bid against each other, providing you their best rates for all your mortgage needs. Apply today\r\n', '', '<p dir=\"ltr\">Last Update Feb 12, 2019</p><p dir=\"ltr\">At Rateco.com, we understand that privacy is a critical issue for our clients. This policy outlines the principles Rateco.com applies when protecting users&#39; privacy, and outlines the principles and commitments we make to you, our client, to protect the privacy of your personal information.</p><p dir=\"ltr\">This policy does not apply to the information collected, used or disclosed with respect to corporate or commercial entities that are clients. However, Rateco exercises the same care and diligence in protecting the confidentiality of this information.</p><h3 dir=\"ltr\"><span style=\"font-size: 14px;\">1. Rateco is accountable for the protection of clients&#39; personal information. While senior management is ultimately accountable for the protection of personal information, the day-to-day monitoring for compliance may be delegated to other staff.</span></h3><h3 dir=\"ltr\"><span style=\"font-size: 14px;\">2. Rateco is committed to ensuring that the appropriate security measures are employed in the transfer of sensitive information. However, when using e-mail or wireless communication, Rateco advises clients that complete confidentiality and security can not be assured.</span></h3><h3 dir=\"ltr\"><span style=\"font-size: 14px;\">3. Rateco is not accountable for any damages suffered when a client transmits personal information through e-mail or wireless communication or when Rateco transmits information at the request of the client.</span></h3><h3 dir=\"ltr\"><span style=\"font-size: 14px;\">4. Rateco has developed policies and procedures to: protect personal information; receive and respond to complaints and inquiries; train staff regarding the policies and procedures; and communicate the policies and procedures to our clients.</span></h3><h3 dir=\"ltr\"><span style=\"font-size: 14px;\">5. Rateco collects client personal information for the following reasons only:</span></h3><ul><li dir=\"ltr\"><p dir=\"ltr\">To provide financial services;</p></li><li dir=\"ltr\"><p dir=\"ltr\">To understand their clients&#39; financial needs;</p></li><li dir=\"ltr\"><p dir=\"ltr\">To facilitate the offering of third party complimentary products or services;</p></li><li dir=\"ltr\"><p dir=\"ltr\">To broker and administer loan agreements;</p></li><li dir=\"ltr\"><p dir=\"ltr\">To develop, manage and deliver products and services to clients;</p></li><li dir=\"ltr\"><p dir=\"ltr\">To develop and deliver marketing and promotional offers to clients;</p></li><li dir=\"ltr\"><p dir=\"ltr\">To determine client eligibility for different products and services;</p></li><li dir=\"ltr\"><p dir=\"ltr\">To ensure that clients receive a high standard of service;</p></li><li dir=\"ltr\"><p dir=\"ltr\">To meet regulatory requirements;</p></li><li dir=\"ltr\"><p dir=\"ltr\">To manage and transfer the assets and liabilities of Rateco.com and those assets under its administration; and,</p></li><li dir=\"ltr\"><p dir=\"ltr\">To verify client&#39;s identity.</p></li></ul><p dir=\"ltr\">Rateco.com will only collect personal information for the purposes identified. Rateco.com will use methods that are lawful and will not collect information indiscriminately. Rateco.com will not use personal information for any additional purpose unless Rateco.com seeks client consent to do so.</p><p dir=\"ltr\">6. Rateco.com will obtain client consent to collect, use or disclose any personal information except where detailed in this policy. Rateco.com will make reasonable efforts to ensure that clients understand how their personal information will be used and disclosed.</p><p dir=\"ltr\">7. A client&#39;s consent can be express, implied, or given through an authorized representative such as a lawyer, agent or broker. Consent may be given orally, in writing, or electronically. For example, depending on the sensitivity of the information, consent can be expressed over the telephone when information is being collected; electronically when submitting an agreement, application, or other information; in writing when signing an agreement or application form. Implied consent exists when Rateco.com can reasonably infer consent based upon the action or inaction of the client.</p><p dir=\"ltr\">8. Rateco.com, however, may collect, use or disclose personal information without the client&#39;s knowledge or consent in exceptional circumstances:</p><ul><li dir=\"ltr\"><p dir=\"ltr\">When such collection, use or disclosure is permitted or required by law</p></li><li dir=\"ltr\"><p dir=\"ltr\">When certain information is publicly available</p></li><li dir=\"ltr\"><p dir=\"ltr\">When we require legal advice from a lawyer</p></li><li dir=\"ltr\"><p dir=\"ltr\">When we need to collect a debt from a client</p></li><li dir=\"ltr\"><p dir=\"ltr\">When we need to deal with an anticipated breach of law</p></li><li dir=\"ltr\"><p dir=\"ltr\">When potential investors/stakeholders wish to ensure the quality and characteristics of an investment.</p></li></ul><p dir=\"ltr\">9. Subject to contractual or legal arrangements, clients may withdraw or refuse consent provided that Rateco.com is given reasonable notice. Rateco.com may decline to deal with a client or person who will not consent to the use of such information.</p><p dir=\"ltr\">10. Rateco.com may periodically use client personal information to conduct client surveys in order to enhance our provision of services or products. If an outside body is employed to conduct research on behalf of Rateco.com, or provide other services that require access to client information, Rateco.com will ensure that appropriate security undertakings, such as confidentiality clauses in contractual arrangements, are employed to protect the transfer and use of personal information.</p><p dir=\"ltr\">11. Rateco.com will retain client personal information only as long as necessary or expected to be necessary for the identified purposes, or as required by legislation.</p><p dir=\"ltr\">12. Rateco.com may disclose personal information related to a financial asset of Rateco.com along with transfer of the financial asset.</p><p dir=\"ltr\">13. Rateco.com will make reasonable efforts to ensure that client personal information is as accurate. In some cases, Rateco.com relies on its clients to ensure that certain information, such as the client&#39;s address or telephone number, is current, complete, and accurate.</p><p dir=\"ltr\">14. Rateco.com will not routinely update information unless it is necessary to fulfill the purposes for which it was collected or if it is required to maintain an active account.</p><p dir=\"ltr\">15. Rateco.com is committed to the safekeeping of client personal information in order to prevent its loss, theft, unauthorized access, disclosure, duplication, use, or modification, and will employ appropriate security measures to protect the information. The measures may include, for example, the physical security of offices and data, and electronic security measures such as passwords and encryption where appropriate.</p><p dir=\"ltr\">16. Rateco.com will use appropriate security measures when disposing of client personal information.</p><p dir=\"ltr\">17. The development of Rateco.com&#39;s policies and procedures for the protection of personal information is an ongoing process. Changes in technology necessitate that Rateco.com continually develops, updates, and reviews information protection guidelines and controls to ensure ongoing information security.</p><p dir=\"ltr\">18. Rateco.com will make the following information available:</p><ul><li dir=\"ltr\"><p dir=\"ltr\">The name, title and address of the person accountable for the policies and procedures and to whom complaints or inquiries can be forwarded;</p></li><li dir=\"ltr\"><p dir=\"ltr\">A description of the type of personal information held by Rateco.com, including a general account of its use;</p></li><li dir=\"ltr\"><p dir=\"ltr\">A copy of any brochures or other information that explain the policies and procedures; and</p></li><li dir=\"ltr\"><p dir=\"ltr\">An explanation of what personal information is made available to affiliated companies or investors.</p></li></ul><p dir=\"ltr\">19. Clients have a right to access their personal information held by Rateco.com. Upon request, Rateco.com will, within a reasonable time period, tell the client what personal information it has, what it is being used for, and to whom it has been disclosed if applicable and within the time period for which records are available.</p><p dir=\"ltr\">20. Clients may be asked to be specific about the information they would like to access and to submit their request in writing to Rateco.com.</p><p dir=\"ltr\">21. Clients will be required to provide personal information to identify themselves to enable Rateco.com to provide an account of the existence, use, and disclosure of personal information.</p><p dir=\"ltr\">22. Rateco.com will make the information available within 30 days, or provide written notice of extension where additional time is required to fulfill the request. When information is not provided within 30 days of the request, Rateco.com will, no later than 30 days after the date of the request, send a notice of extension to the client, advising of the new time limit, the reasons for extending the time limit and of the right of the client to make a complaint regarding the extension.</p><p dir=\"ltr\">23. If a request is refused, Rateco.com will notify the client in writing, documenting the reasons for refusal and resources for redress available to the client.</p><p dir=\"ltr\">24. The information will be made available at a cost that will vary with the type and amount of information requested. Where the client will incur a cost, Rateco.com will inform the client of the cost and request further direction from the client on whether or not Rateco.com should proceed with the request.</p><p dir=\"ltr\">25. In certain situations, Rateco.com may not be able to provide access to any or all personal information about a client. In such cases, Rateco.com will explain the reasons it will not provide the requested information, and identify resources for recourse available to the client. The reasons for not providing information may include that it is unreasonably costly to provide, information that would threaten the life or security of another individual, information generated in a formal dispute resolution process, information that contains references to other individuals, information that cannot be disclosed for legal, security, or commercial proprietary reasons, and information that is subject to solicitor-client or litigation privilege.</p><p dir=\"ltr\">26. If the information is demonstrated to be inaccurate or incomplete, Rateco.com will amend the information as required. Where appropriate, Rateco.com will transmit the amended information to Third Parties having access to the information in question.</p><p dir=\"ltr\">27. Clients are to direct any complaints, concerns or questions regarding this privacy policy in writing to the Compliance Officer. At any point in this process the client may also write to the Privacy Commissioner.</p><p dir=\"ltr\">28. Clients may withdraw consent at any time, subject to legal or contractual restrictions, provided that reasonable notice of withdrawal of consent is given to the Rateco.com. On receipt of notice of withdrawal of consent, Rateco.com will inform the individual of the likely consequences of the withdrawal of consent, which may include the inability of Rateco.com to provide certain products or services, if the information is necessary to provide the products and services.</p><p dir=\"ltr\">29. To improve the usability of our website at www.rateco.com, we capture information about how users interact with our site and what pages they visit. No personal information is collected as part of this process. The data we collect is used internally to better understand and support our users.</p>', '', '', 1, '2019-01-11 13:28:32'),
(8, 'Home Have you heard', 'Introducing <br /><strong>RATECO</strong>', '', '', '', '', '', 'Rateco is the first brokerage in Canada to transfer the power to you, the borrower. The Rateco reverse-auction makes private lenders bid against each other to win your business. With Rateco, you can actually watch the cost of your private mortgage fall, in real-time.', '', '', 1, '2019-02-26 15:27:16'),
