(11, 'RESCO', 'resco', '360 Highway 7 East', 'Unit 28', 'Richmond Hill', 'L4B 3Y7', 'Ontario', 'Canada', '620', 80, '7,000', 'We will lend up to 80% LTV on a purchase and re-finance in the GTA, outside of that we will scale back depending on location. 85% on exceptional basis.\r\n\r\nArea we will lend in as follows:\r\n\r\nAS far south as Downtown Toronto Ã¢â‚¬â€œ as far east as Trenton, - as far north as Collingwood Ã¢â‚¬â€œ as far west as Kitchener/Waterloo\r\n\r\nWe do not have a max loan amount for 1st mortgages Ã¢â‚¬â€œ for 2nd mortgages max loan amount would be $750,000\r\n\r\nProperties we lend on:\r\n\r\nResidential Only! Ã¢â‚¬â€œ detached, semi-detached, townhouse, condo (min 1 bedroom), duplex and tri-plex\r\n\r\nRates:\r\n\r\n1st mortgage starting at 7.99% with fees starting at 1%\r\n\r\n2nd mortgages starting at 9.99% with fees starting at 2%\r\n\r\nWe offer bridge loan, can be even for few days, fee will be prorated.\r\n\r\nWe also offer different term to match the first mortgagesÃ¢â‚¬â„¢ maturity date.\r\n\r\nNo minimum beacon score required\r\n\r\nWe will go behind any major Financial Institutions such as Banks, Trust companies, Credit Unions, etc but will not go behind another private lender or MIC\r\n\r\nHow to submit a deal, please submit the following to deals@rescomic.ca :\r\n\r\n* Mortgage application\r\n\r\n* Credit bureau\r\n\r\n* Appraisal (if available)\r\n\r\n* Brief comment about the deal, purpose of fund and the exit strategy\r\n\r\nOur turnaround time is within 24 hours from Monday to Friday', '30,28,34,32,31,27,29,33', 'Y', '', '2019-03-09 18:34:59', '2019-04-02 11:54:37'),
